import { useEffect, useState } from "react";
import axios from "axios";

const AddRestaurantData = () => {
  const [dataResRestaurants, setDataResRestaurants] = useState([{}]);
  const fetchRestaurantsData = async () => {
    try {
      const responseRestaurant = await axios.get(
        "http://localhost:8080/restaurants"
      );
      setDataResRestaurants(responseRestaurant.result);
    } catch (err) {
      console.log(err);
    }
  };
  useEffect(() => {
    fetchRestaurantsData();
  }, []);

  const RestaurantData = {
    type: "ADD_RESTAURANT_DATA",
    payload: dataResRestaurants,
  };

  return RestaurantData;
};
export default AddRestaurantData;
